"use strict";(self["webpackChunktome_planner"]=self["webpackChunktome_planner"]||[]).push([[9665],{19665:function(e){e.exports=JSON.parse('{"race_list":["HUMAN","ELF","HALFLING","DWARF","YEEK","GIANT","UNDEAD","ORC","YETI","MINOTAURUNDEAD"],"races":{"DWARF":{"desc":"<p>Dwarves are a secretive people, hailing from their underground home of the Iron Throne.</p><p>They are a sturdy race and are known for their masterwork, yet they are not well loved, having left other races to fend for themselves in past conflicts.</p><p>All dwarves are united under the Empire and their love of money.</p>","display_name":"Dwarf","name":"Dwarf","short_name":"DWARF","subrace_list":["DWARF","DREM"]},"ELF":{"desc":"<p>The elven races are usually named as a whole \'elves\', but this is incorrect.</p><p>Elves are split into three separate races - albeit related - of which only two remain in the current age.</p><p>Elves usually live about one thousand years, except for the Shaloren who magically sustain themselves forever.</p><p>Their view of the world varies wildly across the different elven races.</p>","display_name":"Elf","name":"Elf","short_name":"ELF","subrace_list":["SHALORE","THALORE","DOOMELF"]},"GIANT":{"desc":"<p><span style=\\"font-style: italic\\"><span class=\\"tstr-font-italic\\">\\"Giant\\"</span></span> is a catch-all term for humanoids which are typically over eight feet in height.  Their origins, cultures, and relationships to other races differ wildly, but they tend to live as refugees and outcasts, shunned by smaller sentient races who usually see them as a threat.</p>","display_name":"Giant","locked_desc":"Powerful beings that tower over all, but the bigger they are, the harder they fall...","name":"Giant","short_name":"GIANT","subrace_list":["OGRE","KROG"]},"HALFLING":{"desc":"<p>Halflings are a race of very short stature, rarely exceeding four feet in height.</p><p>They are like humans in that they can do just about anything they set their minds to, yet they excel at ordering and studying things.</p><p>Halfling armies have brought many kingdoms to their knees and they kept a balance of power with the Human kingdoms during the Age of Allure.</p><p>Halflings are agile, lucky, and resilient but lacking in strength.</p>","display_name":"Halfling","name":"Halfling","short_name":"HALFLING","subrace_list":["HALFLING"]},"HUMAN":{"desc":"<p>The Humans are one of the main races on Maj\'Eyal, along with the Halflings. For many thousands of years they fought each other until events, and great people, unified all the Human and Halfling nations under one rule.</p><p>Humans of these Allied Kingdoms have known peace for over a century now.</p><p>Humans are split into two categories: the Highers, and the rest. Highers have latent magic in their blood which gives them higher attributes and senses along with a longer life.</p><p>The rest of Humanity is gifted with quick learning and mastery. They can do and become anything they desire.</p>","display_name":"Human","name":"Human","short_name":"HUMAN","subrace_list":["HIGHER","CORNAC"]},"MINOTAURUNDEAD":{"desc":"<p>Undead are humanoids (Humans, Elves, Dwarves, ...) that have been brought back to life by the corruption of dark magics.</p><p>Undead can take many forms, from ghouls to vampires and liches.</p>","display_name":"Undead","locked_desc":"Grave strength, dread will, this flesh cannot stay still. Kings die, masters fall, we will outlast them all.","name":"MinotaurUndead","short_name":"MINOTAURUNDEAD","subrace_list":["WHITEHOOF"]},"ORC":{"desc":"<p>Orcs have a long and sad history. They are seen, and are, as an aggressive race that more than one time managed to imperil all of Maj\'Eyal.</p><p>But one year ago the Scourge from the West came and wiped four of the five Prides. And a hundred years ago King Toknor wiped all traces of orcs from Maj\'Eyal.</p><p>The orc race is dangerously on the brink of destruction. One wrong move is all that is needed.</p><p>But they are strong and will face whatever is needed to ensure a future of their own!</p>","display_name":"Orc","name":"Orc","short_name":"ORC","subrace_list":["ORC"]},"UNDEAD":{"desc":"<p>Undead are humanoids (Humans, Elves, Dwarves, ...) that have been brought back to life by the corruption of dark magics.</p><p>Undead can take many forms, from ghouls to vampires and liches.</p>","display_name":"Undead","locked_desc":"Grave strength, dread will, this flesh cannot stay still. Kings die, masters fall, we will outlast them all.","name":"Undead","short_name":"UNDEAD","subrace_list":["GHOUL","SKELETON"]},"YEEK":{"desc":"<p>Yeeks are a mysterious race of small humanoids native to the tropical island of Rel.</p><p>Their body is covered with white fur and their disproportionate heads give them a ridiculous look.</p><p>Although they are now nearly unheard of in Maj\'Eyal, they spent many thousand years as secret slaves to the Halfling nation of Nargol.</p><p>They gained their freedom during the Age of Pyre and have since then followed \'The Way\' - a unity of minds enforced by their powerful psionics.</p>","display_name":"Yeek","locked_desc":"One race, one mind, one way. Our oppression shall end, and we shall inherit Eyal. Do not presume we are weak - our way is true, and only those who help us shall see our strength.","name":"Yeek","short_name":"YEEK","subrace_list":["YEEK"]},"YETI":{"desc":"<p>Yetis are a towering mass of muscle.</p>","display_name":"Yeti","locked_desc":"Infuse the mind, sacrifice the body but the Pride remains.","name":"Yeti","short_name":"YETI","subrace_list":["KRUK_YETI"]}},"subraces":{"CORNAC":{"copy":{"default_wilderness":["playerpop","allied"],"extra_generic_point_every":10,"extra_talent_point_every":10,"faction":"allied-kingdoms","life_rating":10,"moddable_tile":"human_#sex#","moddable_tile_base":"base_01.png","random_name_def":"cornac_#sex#","starting_intro":"cornac","starting_quest":"start-allied","starting_zone":"trollmire","subtype":"human","type":"humanoid"},"desc":"<p>Cornacs are Humans from the northern parts of the Allied Kingdoms.</p><p>Humans are an inherently very adaptable race and as such they gain a <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">talent category point</span></span> at birth (others only gain one at levels 10, 20 and 34). They also gain </span></span><span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">a class and a generic talent point</span></span> at birth and every 10 levels.</span></span></p>","display_name":"Cornac","experience":1,"images":[],"name":"Cornac","short_name":"CORNAC"},"DOOMELF":{"copy":{"_forbid_start_override":true,"ashes_urhrok_race_start_quest":"start-shaloren","default_wilderness":["zone-pop","angolwen-portal"],"faction":"shalore","life_rating":9,"moddable_tile":"elf_#sex#","moddable_tile_base":"demonic_01.png","random_name_def":"shalore_#sex#","random_name_max_syllables":4,"starting_intro":"ashes-urhrok","starting_quest":"ashes-urhrok+start-ashes","starting_zone":"ashes-urhrok+searing-halls","subtype":"elf","type":"humanoid"},"desc":"<p>Doomelves are not a real race, they are Shaloren that have been taken by demons and transformed into harbingers of doom.</p><p>They enjoy unleashing torments and suffering on their victims.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Haste of the Doomed</span></span> talent which allows them to phase away once in a while.</span></span></p>","display_name":"Doomelf","experience":1.12,"images":[{"file":"npc/demon_statue_uruivellas-cropped.png","height":106,"width":61}],"locked_desc":"The demons of Mal\'Rok would never bless you!\\nThree could tell them of the horrors elves wrought.\\nOne rages and torments in deep oceans blue,\\none fights for the third with the cultists she taught.\\nSilence these beings, maintain your deception,\\nand then you may witness a new elf\'s conception...","name":"Doomelf","short_name":"DOOMELF","stats":{"con":1,"cun":0,"dex":1,"mag":3,"str":-2,"wil":2}},"DREM":{"copy":{"_forbid_start_override":true,"calendar":"dwarf","cults_race_start_quest":"start-allied","default_wilderness":[20,17],"faction":"sanctuary-of-horrors","life_rating":12,"moddable_tile":"dwarf_#sex#","moddable_tile_base":"base_drem_01.png","random_name_def":"dwarf_#sex#","random_name_max_syllables":4,"starting_intro":"cults","starting_quest":"cults+start-cults","starting_zone":"cults+town-kroshkkur","subtype":"dwarf","type":"humanoid"},"desc":"<p>Drem are mindless mutants who live deep in the earth. It is only recently that thinking Drem have appeared among them. They still remain deep below Eyal\'s surface, believing that they would not be welcomed among the surface races.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Frenzy</span></span> talent which allows them to ignore cooldowns once in a while.</span></span></p>","display_name":"Drem","experience":1.12,"images":[],"locked_desc":"Faceless, but not mindless.","name":"Drem","short_name":"DREM","stats":{"con":1,"dex":1,"mag":2,"str":3,"wil":-1}},"DWARF":{"copy":{"calendar":"dwarf","can_see_iron_council":1,"default_wilderness":["playerpop","dwarf"],"faction":"iron-throne","life_rating":14,"moddable_tile":"dwarf_#sex#","moddable_tile_ornament2":{"female":"braid_01","male":"beard_02"},"random_name_def":"dwarf_#sex#","starting_intro":"dwarf","starting_quest":"start-dwarf","starting_zone":"reknor-escape","subtype":"dwarf","type":"humanoid"},"desc":"<p>Dwarves are a secretive people, hailing from their underground home of the Iron Throne.</p><p>They are a sturdy race and are known for their masterwork, yet they are not well loved, having left other races to fend for themselves in past conflicts.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Resilience of the Dwarves</span></span> which allows them to increase their armour, physical and spell saves for a few turns.</span></span></p>","display_name":"Dwarf","images":[],"name":"Dwarf","short_name":"DWARF","stats":{"con":3,"dex":-2,"mag":-2,"str":4,"wil":3}},"GHOUL":{"copy":{"cut_immune":1,"default_wilderness":["playerpop","low-undead"],"fear_immune":1,"forbid_nature":1,"global_speed_base":0.8,"inscription_forbids":{"inscriptions/infusions":true},"life_rating":14,"moddable_tile":"ghoul","moddable_tile_nude":1,"poison_immune":0.8,"starting_intro":"ghoul","starting_level":3,"starting_level_force_down":true,"starting_quest":"start-undead","starting_zone":"blighted-ruins","stun_immune":0.5,"subtype":"ghoul","true_undead":1,"type":"undead","undead":1},"desc":"<p>Ghouls are dumb, but resilient, rotting undead creatures, making good fighters.</p><p>They have access to <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">special ghoul talents</span></span> and a wide range of undead abilities:</span></span></p><p>- great poison resistance</p><p>- bleeding immunity</p><p>- stun resistance</p><p>- fear immunity</p><p>- special ghoul talents: ghoulish leap, gnaw and retch</p><p>The rotting bodies of ghouls also force them to act a bit more slowly than most creatures.</p>","display_name":"Ghoul","experience":1.12,"images":[],"locked_desc":"Slow to shuffle, quick to bite, learn from master, rule the night!","name":"Ghoul","short_name":"GHOUL","stats":{"con":5,"cun":-2,"dex":1,"mag":0,"str":3,"wil":-2}},"HALFLING":{"copy":{"default_wilderness":["playerpop","allied"],"faction":"allied-kingdoms","life_rating":12,"moddable_tile":"halfling_#sex#","random_name_def":"halfling_#sex#","size_category":2,"starting_intro":"halfling","starting_quest":"start-allied","starting_zone":"trollmire","subtype":"halfling","type":"humanoid"},"desc":"<p>Halflings are a race of very short stature, rarely exceeding four feet in height.</p><p>They are like humans in that they can do just about anything they set their minds to, yet they excel at ordering and studying things.</p><p>Halfling armies have brought many kingdoms to their knees and they kept a balance of power with the Human kingdoms during the Age of Allure.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Luck of the Little Folk</span></span> which allows them to increase their critical strike chance and saves for a few turns.</span></span></p>","display_name":"Halfling","experience":1.1,"images":[],"name":"Halfling","short_name":"HALFLING","size":"small","stats":{"con":1,"cun":3,"dex":3,"lck":5,"str":-3}},"HIGHER":{"copy":{"default_wilderness":["playerpop","allied"],"faction":"allied-kingdoms","life_rating":11,"moddable_tile":"human_#sex#","moddable_tile_base":"base_01.png","random_name_def":"higher_#sex#","starting_intro":"higher","starting_quest":"start-allied","starting_zone":"trollmire","subtype":"human","type":"humanoid"},"desc":"<p>Highers are a special branch of Humans that have been imbued with latent magic since the Age of Allure.</p><p>They usually do not breed with other Humans, trying to keep their blood \'pure\'.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Wrath of the Highborn</span></span> which allows them to increase damage dealt and decrease damage taken once in a while.</span></span></p>","display_name":"Higher","images":[],"name":"Higher","short_name":"HIGHER","stats":{"dex":1,"mag":1,"str":1,"wil":1}},"KROG":{"copy":{"default_wilderness":[24,14],"faction":"zigur","forbid_arcane":1,"life_rating":13,"moddable_tile":"ogre_#sex#","moddable_tile_base":"krog_base_01.png","moddable_tile_ornament":{"female":"krog_deco_braids_default","male":"krog_deco_beard_default"},"random_name_def":"thalore_#sex#","random_name_max_syllables":4,"size_category":4,"starting_intro":"krog","starting_quest":"start-allied","starting_zone":"ruins-kor-pul","subtype":"krog","type":"giant"},"desc":"<p>Krogs were formerly Ogres, that have been radically changed. Stripped of the runes from their bodies, the Ziguranth have managed to prevent the Krog from dying by injecting them with a concoction of natural infusions and drake blood. The Krog are entirely devoted to the anti-magic cause and seemingly know of nothing else in their lives.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Wrath of the Wilds</span></span> talent which allows them to stun/daze their foes.</span></span></p>","display_name":"Krog","experience":1.15,"images":[],"locked_desc":"Once an abomination, now a weapon.","name":"Krog","short_name":"KROG","size":"big","stats":{"con":2,"dex":-1,"mag":-2,"str":3,"wil":2}},"KRUK_YETI":{"copy":{"auto_id":100,"default_wilderness":["playerpop","yeti"],"faction":"kruk-pride","life_rating":13,"moddable_tile":"yeti","moddable_tile_head_underwear":"fur_head.png","moddable_tile_higher_underwear":"fur_body.png","moddable_tile_lower_underwear":"fur_legs.png","starting_intro":"orc-yeti","starting_quest":"orcs+start-orc","starting_zone":"orcs+vaporous-emporium","subtype":"yeti","type":"giant"},"desc":"<p>Yetis are a towering mass of muscle. While normal yetis are non-sentient beasts this kind is special.</p><p>A few orcs of the Kruk pride have mastered techno-psionics, allowing them to literally hijack a yeti\'s mind and transfer their own mind inside.</p><p>Doing so drains their old knowledge and they need to start afresh, gaining considerable strength in the process; for the good of the Prides.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Algid Rage</span></span> talent which allows them to encase their foes in blocks of ice.</span></span></p>","display_name":"Kruk Yeti","experience":1.12,"images":[{"file":"npc/giant_yeti_yeti-cropped.png","height":77,"width":64}],"locked_desc":"Infuse the mind, sacrifice the body but the Pride remains.","name":"Kruk Yeti","short_name":"KRUK_YETI","stats":{"con":4,"cun":-1,"dex":-3,"str":5,"wil":1}},"LICH":{"desc":"<p></p>","display_name":"Lich","images":[],"locked_desc":"You should not see this!","name":"Lich","short_name":"LICH"},"OGRE":{"copy":{"default_wilderness":["playerpop","shaloren"],"faction":"shalore","life_rating":13,"moddable_tile":"ogre_#sex#","random_name_def":"shalore_#sex#","random_name_max_syllables":4,"size_category":4,"starting_intro":"ogre","starting_quest":"start-shaloren","starting_zone":"scintillating-caves","subtype":"ogre","type":"giant"},"desc":"<p>Ogres are an altered form of Human, created in the Age of Allure as workers and warriors for the Conclave.</p><p>Inscriptions have granted them magical and physical power far beyond their natural limits, but their dependence on runic magic made them a favored target during the Spellhunt, forcing them to take refuge among the Shalore.</p><p>Their preference for simple and direct solutions has given them an undeserved reputation as dumb brutes, despite their extraordinary talent with runes and their humble, dutiful nature.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Ogric Wrath</span></span> talent, which grants them critical chance and power, as well as resistance to confusion and stuns, when their attacks miss or are blocked.</span></span></p>","display_name":"Ogre","experience":1.15,"images":[{"file":"npc/giant_ogre_ogre_guard-cropped.png","height":112,"width":64}],"locked_desc":"Forged in the hatred of ages long passed,\\nmade for a war that they\'ve come to outlast.\\nTheir forgotten birthplace lies deep underground,\\nits tunnels ruined so it wouldn\'t be found.\\nPast burglars have failed, but their data\'s immortal;\\nto start, look where halflings once tinkered with portals...","name":"Ogre","short_name":"OGRE","size":"big","stats":{"con":0,"cun":2,"dex":-1,"mag":2,"str":3,"wil":-2}},"ORC":{"copy":{"auto_id":100,"default_wilderness":["playerpop","orc"],"faction":"kruk-pride","life_rating":12,"moddable_tile":"orc_#sex#","starting_intro":"orc","starting_quest":"orcs+kruk-invasion","starting_zone":"orcs+town-kruk","subtype":"orc","type":"humanoid"},"desc":"<p>Orcs have a long and sad history. They are seen, and are, as an aggressive race that more than one time managed to imperil all of Maj\'Eyal.</p><p>But one year ago the Scourge from the West came and wiped four of the five Prides. And a hundred years ago King Toknor wiped all traces of orcs from Maj\'Eyal.</p><p>The orc race is dangerously on the brink of destruction. One wrong move is all that is needed.</p><p>But they are strong and will face whatever is needed to ensure a future of their own!</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Orcish Fury</span></span> which allows them to increase all their damage for a few turns.</span></span></p>","display_name":"Orc","experience":1.12,"images":[{"file":"npc/humanoid_orc_orc_warrior.png"}],"name":"Orc","short_name":"ORC","stats":{"con":1,"cun":1,"dex":1,"mag":-1,"str":2,"wil":1}},"SHALORE":{"copy":{"default_wilderness":["playerpop","shaloren"],"faction":"shalore","life_rating":9,"moddable_tile":"elf_#sex#","moddable_tile_base":"base_01.png","moddable_tile_ornament":{"female":"braid_02"},"random_name_def":"shalore_#sex#","random_name_max_syllables":4,"starting_intro":"shalore","starting_quest":"start-shaloren","starting_zone":"scintillating-caves","subtype":"elf","type":"humanoid"},"desc":"<p>Shaloren elves have close ties with the magic of the world, and produced in the past many great mages.</p><p>Yet they remain quiet and try to hide their magic from the world, for they remember too well the Spellblaze - and the Spellhunt that followed.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Grace of the Eternals</span></span> talent which allows them a boost of speed every once in a while.</span></span></p>","display_name":"Shalore","experience":1.12,"images":[],"name":"Shalore","short_name":"SHALORE","stats":{"con":0,"cun":1,"dex":1,"mag":2,"str":-2,"wil":3}},"SKELETON":{"copy":{"blood_color":{"b":127,"g":127,"r":127},"cut_immune":1,"default_wilderness":["playerpop","low-undead"],"fear_immune":1,"forbid_nature":1,"inscription_forbids":{"inscriptions/infusions":true},"life_rating":12,"moddable_tile":"skeleton","moddable_tile_nude":1,"no_breath":1,"poison_immune":1,"starting_intro":"skeleton","starting_level":3,"starting_level_force_down":true,"starting_quest":"start-undead","starting_zone":"blighted-ruins","subtype":"skeleton","true_undead":1,"type":"undead","undead":1},"desc":"<p>Skeletons are animated bones, undead creatures both strong and dexterous.</p><p>They have access to <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">special skeleton talents</span></span> and a wide range of undead abilities:</span></span></p><p>- poison immunity</p><p>- bleeding immunity</p><p>- fear immunity</p><p>- no need to breathe</p><p>- special skeleton talents: bone armour, resilient bones, re-assemble</p>","display_name":"Skeleton","experience":1.2,"images":[],"locked_desc":"The marching bones, each step we rattle; but servants no more, we march to battle!","name":"Skeleton","short_name":"SKELETON","stats":{"con":0,"cun":0,"dex":4,"mag":0,"str":3,"wil":0}},"THALORE":{"copy":{"default_wilderness":["playerpop","thaloren"],"faction":"thalore","life_rating":11,"moddable_tile":"elf_#sex#","moddable_tile_base":"base_01.png","moddable_tile_ornament":{"female":"braid_01"},"random_name_def":"thalore_#sex#","starting_intro":"thalore","starting_quest":"start-thaloren","starting_zone":"norgos-lair","subtype":"elf","type":"humanoid"},"desc":"<p>Thaloren elves have spent most of the ages hidden within their forests, seldom leaving them.</p><p>The ages of the world passed by and yet they remained unchanged.</p><p>Their affinity for nature and their reclusion have made them great protectors of the natural order, often opposing their Shaloren cousins.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Gift of the Woods</span></span> talent, which allows them to regenerate life and increase healing once in a while.</span></span></p>","display_name":"Thalore","images":[],"name":"Thalore","short_name":"THALORE","stats":{"con":1,"cun":0,"dex":3,"mag":-2,"str":2,"wil":1}},"WHITEHOOF":{"copy":{"auto_id":100,"cut_immune":1,"default_wilderness":["playerpop","yeti"],"faction":"free-whitehooves","forbid_nature":1,"inscription_forbids":{"inscriptions/infusions":true},"life_rating":14,"moddable_tile":"whitehoof","moddable_tile_base":"base_01.png","moddable_tile_nude":1,"no_breath":1,"poison_immune":1,"silence_immune":0.5,"starting_intro":"orc-whitehooves","starting_quest":"orcs+start-orc","starting_zone":"orcs+vaporous-emporium","subtype":"minotaur","true_undead":1,"type":"undead","undead":1},"desc":"<p>A clan of minotaurs turned to necromancy when faced with imminent destruction.</p><p>Whitehooves are resilient and magic imbued undead, hardened by their trials and made stronger by their undeath.</p><p>They now seek to help their orc allies, in hope they will help them back.</p><p>They have access to <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">special talents</span></span> and a wide range of undead abilities:</span></span></p><p>- silence resistance</p><p>- bleeding immunity</p><p>- fear immunity</p><p>- no need to breathe</p><p>- special whitehoof talents: dead hide, lifeless rush, essence drain</p>","display_name":"Whitehoof","experience":1.15,"images":[{"file":"npc/undead_minotaur_whitehoof_maulotaur-cropped.png","height":92,"width":63}],"locked_desc":"Grave strength, dread will, this flesh cannot stay still. Kings die, masters fall, we will outlast them all.","name":"Whitehoof","short_name":"WHITEHOOF","stats":{"con":2,"cun":1,"dex":-1,"mag":2,"str":3,"wil":-3}},"YEEK":{"copy":{"blood_color":{"b":227,"g":0,"r":0},"confusion_immune":0.35,"default_wilderness":["playerpop","yeek"],"faction":"the-way","life_rating":7,"max_air":200,"moddable_tile":"yeek","moddable_tile_nude":1,"random_name_def":"yeek_#sex#","size_category":2,"starting_intro":"yeek","starting_quest":"start-yeek","starting_zone":"town-irkkk","subtype":"yeek","type":"humanoid"},"desc":"<p>Yeeks are a mysterious race native to the tropical island of Rel.</p><p>Although they are now nearly unheard of in Maj\'Eyal, they spent many centuries as secret slaves to the Halfling nation of Nargol.</p><p>They gained their freedom during the Age of Pyre and have since then followed \'The Way\' - a unity of minds enforced by their powerful psionics.</p><p>They possess the <span style=\\"color: #ffd700\\"><span class=\\"tstr-color-GOLD\\">Dominant Will</span></span> talent which allows them to temporarily subvert the mind of a lesser creature. When the effect ends, the creature dies.</span></span></p><p>While Yeeks are not amphibians, they still have an affinity for water, allowing them to survive longer without breathing.</p>","display_name":"Yeek","experience":0.85,"images":[],"locked_desc":"One race, one mind, one way. Our oppression shall end, and we shall inherit Eyal. Do not presume we are weak - our way is true, and only those who help us shall see our strength.","name":"Yeek","short_name":"YEEK","size":"small","stats":{"con":-5,"cun":4,"dex":-2,"mag":0,"str":-3,"wil":6}}}}')}}]);